import React from 'react';
import { Table } from 'reactstrap';

export class Row extends React.Component {
  render() {
    return (
      <Table>
        <tbody>
          <tr>
          {
            React.Children.toArray(
              Object.values(this.props.data).map( value => 
                <td>{value}</td>
              )
            )
          }
          </tr>
        </tbody>
      </Table>
    );
  }
}
